import MyCard from "../UI/MyCard";
import { useSelector } from "react-redux";
import LoadingSpinnerp from "../UI/LoadingSpinnerp";
import style from "./CardData.module.css"
import { useState } from "react";


const CardData = ()=>{
    const getSuccess = useSelector(state=>state.myPage.getSuccess)
    const viziblePage = useSelector(state=>state.myPage.pageList)
    let showRow

    const rowHadler=(n)=>{ 

        return [...Array(n)].map((e, i) => <div className={style.rowStyle}>
        {viziblePage[(0+i)].map((item)=>
         <MyCard 
         my_number = {item.my_number}
         card_element = {item.card_element}
         />)
         }
         </div> )
    
    }

    return <div >
        <div>
            <button>Flip Card</button>
            <button>Sort Card</button>
        </div>
        <div className={style.mainpage}>
            {getSuccess ? rowHadler(4) : <LoadingSpinnerp/>}
        </div>
    </div>

}

export default CardData;
